column8:
FJクルーザー2010年以降、ランクル150プラド<br>
のフロントスタビライザーの<br>
オフセットスペーサーです。<br>
取り付けピッチ82ミリ<br>
リフトアップにより突っ張っリ気味となり、<br>
車両によってはショックアブソーバーと<br>
スタビライザーが干渉したりします。<br>
純正取り付け位置より15mmダウンさせ、<br>
15mm前進させて取り付けます。<br>
突っ張りが解消されスムーズな動きが得られます。<br>
2～2.5インチアップ程度まで対応します。<br>
取り付けの際、フレームにスペーサーを<br>
取り付けるために使うキャップボルトは、<br>
構造上スプリングワッシャー等の<br>
緩み止めが使えませんので、<br>
少量のネジロック（ロックタイト）等を併用して下さい。 
<br>送料区分 ： 120<!-- ここから リア受 -->
